var Router = {
	routes: [],
	currentRoute: '',
	mode: null,
	root: '/',
	config: function(options) {
		this.mode = options && options.mode && options.mode == 'history'
					&& !!(history.pushState) ? 'history' : 'hash';
		this.root = options && options.root ? '/' + this.clearSlashes(options.root) + '/' : '/';
		return this;
	},
	getFragment: function() { // get's current query string/hash & clears slashes from beginning and end
		var fragment = '';
		if (this.mode === 'history') {
			/*fragment = this.clearSlashes(decodeURI(location.pathname + location.search));
			fragment = fragment.replace(/\?(.*)$/, '');
			fragment = this.root != '/' ? fragment.replace(this.root, '') : fragment;*/
			//fragment = location.search.replace(/\?\//, '').replace(/&wrapper_nonce(.*)$/, '');
			fragment = document.location.search.replace(/&wrapper_nonce=([A-Za-z0-9]+)/, "").replace(/\?\//, '');
		} else {
			var match = window.location.href.match(/#(.*)$/);
			fragment = match ? match[1] : '';
		}
		return this.clearSlashes(fragment);
	},
	clearSlashes: function(path) {
		return path.toString().replace(/\/$/, '').replace(/^\//, '');
	},
	add: function(re, handler) {
		if (typeof re == 'function') {
			handler = re;
			re = '';
		}
		this.routes.push({ re: re, handler: handler });
		return this;
	},
	remove: function(param) {
		for (var i = 0, r; i < this.routes.length, r = this.routes[i]; i++) {
			if (r.handler === param || r.re.toString() === param.toString()) {
				this.routes.splice(i, 1);
				return this;
			}
		}
		return this;
	},
	flush: function() {
		this.routes = [];
		this.mode = null;
		this.root = '/';
		return this;
	},
	check: function(f) {
		var fragment = f || this.getFragment();
		//console.log(fragment);
		for (var i = 0; i < this.routes.length; i++) {
			var match = fragment.match(this.routes[i].re);
			//console.log(match);
			if (match) {
				match.shift();
				//console.log(match);
				this.currentRoute = f;
				this.routes[i].handler.apply({}, match);
				return this;
			}
		}
		return this;
	},
