	navigate: function(path) {
		path = path ? path : '';
		if (this.mode === 'history') {
			zeroframe.cmd('wrapperPushState', [{"route": path}, null, this.root + this.clearSlashes(path)]);
			this.check(path);
		} else {
			window.location.href = window.location.href.replace(/#(.*)$/, '') + '#' + path;
		}
		return this;
	}
}

